import React from 'react'
import functionHooks from './Hookset'

const Hooks = () => {
    const [value,handk] = functionHooks(
        {
            name: '',
            age: ''
        })

    return (
        <div>
            <h1>Welcome {value.name} ! {value.age}</h1>
        </div>
    )
}

export default Hooks;
